import { togglePanel } from "../../api/logic/toggle";
import "./privatechat.css";


export default function PrivateChat({ users }){

    return(
        <div className="private-chats">
            <header>
                <div className="private-channel-toggle">
                    <div className="toggle" onClick={togglePanel(".private-channels")}>
                        <AiOutlineDown/>
                    </div>
                </div>
                <h4>Private Channels</h4>
                <p className="private-channel-count">{users.length}</p>
            </header>
            <div className="private-channels">
                {
                    users.map(user => {
                        return(
                            <div className="private">
                                <UserIcon key={user.id} userName={user.name}/>
